import { LinkComponent } from "../components/LinkComponent";

const IndexPage = () => {
  return (
    <main>
      <div >
        <h1>Welcome to this travel experience</h1>
        <LinkComponent text={"Go to second page"} path={"/page2"}/>
      </div>
    </main>
  );
}

export{IndexPage};
